/**
 * swiper horizontal
 * @return {[type]} [description]
 <div class="swiper swiper-horizontal">
      <div class="swiper-wrapper">
       <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-1.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-2.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-3.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-4.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-5.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-6.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-7.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-8.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-9.jpg" />
        </div>
        <div class="swiper-slide">
          <img src="https://swiperjs.com/demos/images/nature-10.jpg" />
        </div>
      </div>
      <div class="swiper-button-next"></div>
      <div class="swiper-button-prev"></div>
    </div>
    <div thumbsSlider="" class="swiper mySwiper thumbsSlider">
    </div>
 */
Swiper.Horizontal = function(options){
    var box = options.ele;
    var mySwiper2_wrapper = box.addClass("swiper-horizontal").find(".swiper-wrapper");
    if(mySwiper2_wrapper.length==0){
        box.html(`<div class="swiper-wrapper">
       
       ${(options.data||[]).map(function(v){
         return `<div class="swiper-slide">
              ${options.renderItem?options.renderItem(v):'<img src="https://swiperjs.com/demos/images/nature-1.jpg" />'}
            </div>`;
       }).join("")}
        
      </div>
      <div class="swiper-button-next"></div>
      <div class="swiper-button-prev"></div>
    </div>
    <div thumbsSlider="" class="swiper mySwiper thumbsSlider">`)
    }

    

  var mySwiper_container = box.find(".thumbsSlider"),
  clone = mySwiper2_wrapper.cloneNode(true);
  mySwiper_container.appendChild(clone);

  var swiper = new Swiper(mySwiper_container[0], {
    loop: true,
    spaceBetween: 10,
    slidesPerView: mySwiper2_wrapper.childNodes.length,
    freeMode: true,
    watchSlidesProgress: true });


  var swiper2 = new Swiper(box[0], {
    autoplay: {
      delay: 5000,
      disableOnInteraction: false },

    slidesPerView: "auto",
    centeredSlides: true,
    loop: true,
    loopedSlides: mySwiper2_wrapper.childNodes.length,
    spaceBetween: 10,
    speed: 800,
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev" },

    thumbs: {
      swiper: swiper } });

  swiper2.on('slideChange', function () {
      if(options.slideChange){
        options.slideChange.call(this);
      }
  });
 
};

/**
 * swiper Vertical
 * @return {[type]} [description]
   <!-- Slider main wrapper -->
<div class="swiper-container-wrapper swiper-vertical">
  <!-- Slider main container -->
  <div class="swiper-container gallery-top">
    <!-- Additional required wrapper -->
    <div class="swiper-wrapper">
      <!-- Slides -->
      <div class="swiper-slide">
        <div class="title">Responsive vertical thumbnail gallery</div>
        <div class="description">Scale screen to see effect</div>
      </div>
      <div class="swiper-slide">
        <div class="title">Slide 2</div>
        <div class="description">Lorem ipsum dolor sit amet</div>
      </div>
      <div class="swiper-slide">
        <div class="title">Slide 3</div>
        <div class="description">Lorem ipsum dolor sit amet</div>
      </div>
      <div class="swiper-slide">
        <div class="title">Slide 4</div>
        <div class="description">Lorem ipsum dolor sit amet</div>
      </div>
      <div class="swiper-slide">
        <div class="title">Slide 5</div>
        <div class="description">Lorem ipsum dolor sit amet</div>
      </div>
      <div class="swiper-slide">
        <div class="title">Slide 6</div>
        <div class="description">Lorem ipsum dolor sit amet</div>
      </div>
    </div>
    <!-- Add Arrows -->
    <div class="swiper-button-next"></div>
    <div class="swiper-button-prev"></div>
  </div>
  <!-- Slider thumbnail container -->
  <div class="swiper-container gallery-thumbs">
    <!-- Additional required wrapper -->
    <div class="swiper-wrapper">
      <!-- Slides -->
      <div class="swiper-slide">Slide 1</div>
      <div class="swiper-slide">Slide 2</div>
      <div class="swiper-slide">Slide 3</div>
      <div class="swiper-slide">Slide 4</div>
      <div class="swiper-slide">Slide 5</div>
      <div class="swiper-slide">Slide 6</div>
    </div>
  </div>
</div>
 */
Swiper.Vertical = function(options){
    var box = options.ele;
    var mySwiper2_wrapper = box.addClass("swiper-vertical").find(".swiper-wrapper");
    if(mySwiper2_wrapper.length==0){
        box.html(`<div class="swiper-container-wrapper"> 
            <div class="swiper-vertical swiper-container gallery-top">
                <div class="swiper-wrapper">
       
       ${(options.data||[]).map(function(v){
         return `<div class="swiper-slide">
              ${options.onRenderItem?options.onRenderItem(v):`<div class="title">Responsive vertical thumbnail gallery</div>
        <div class="description">Scale screen to see effect</div>`}
            </div>`;
       }).join("")}
        
              </div>
              <div class="swiper-button-next"></div>
              <div class="swiper-button-prev"></div>
        </div>
    </div>
    <div class="swiper-container gallery-thumbs">
     <div class="swiper-wrapper">
        ${(options.data||[]).map(function(v){
         return `<div class="swiper-slide">
              ${options.onRenderThumbnailItem?options.onRenderThumbnailItem(v):`<img src="https://swiperjs.com/demos/images/nature-1.jpg" />`}
            </div>`;
       }).join("")}
     </div>
    </div>
</div>
 `)
    }

    var galleryThumbs = new Swiper(box.find(".gallery-thumbs")[0], {
    centeredSlides: true,
    centeredSlidesBounds: true,
    direction: "horizontal",
    spaceBetween: 10,
    slidesPerView: 3,
    freeMode: false,
    watchSlidesVisibility: true,
    watchSlidesProgress: true,
    watchOverflow: true,
    breakpoints: {
      480: {
        direction: "vertical",
        slidesPerView: 3 } } });



  var galleryTop = new Swiper(box.find(".gallery-top")[0], {
    direction: "horizontal",
    spaceBetween: 10,
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev" },

    thumbs: {
      swiper: galleryThumbs } });


  galleryTop.on('slideChangeTransitionStart', function () {
    galleryThumbs.slideTo(galleryTop.activeIndex);
  });
  galleryThumbs.on('transitionStart', function () {
    galleryTop.slideTo(galleryThumbs.activeIndex);
  });

  galleryTop.on('slideChange', function () {
      if(options.slideChange){
        options.slideChange.call(this);
      }
  });
 
};



