(function(win){

	win.QRaccess = {
        create : function(data){
            return 'https://api.qrserver.com/v1/create-qr-code/?size=150x150&data='+encodeURIComponent(typeof data=="object"?JSON.stringify(data):data);
        },
        parse: function (str){
           var a = JSON.parse(str.replace("qraccess|",""));
           return {shop_id:a.s,id_outlet:a.o,token:a.t};
        },
		client : function(options){
			var fb = new Firebase(options.host);
        	var qraccess = fb.child('qraccess');
        	var loaded =0;

	        qraccess.limitToLast(1).on("child_added",function(snapshot){
	          if(loaded==0){
	            setTimeout(function(){
	              loaded =1;
	            },1000);
	            return;
	          }
	          var data = snapshot.val();
	          console.log('User data: ',data);
	          var s = QRaccess.client.valid(data);
	          if(s===true){  

	          	if(options.onComplete)options.onComplete(data); 
              }else{
              	 if(options.onError)options.onError(s); 
              }

	        });
	        //
        	QRaccess.client= {
                onChange: function (f,timer){
                    var me = this;
                   if(f){
                      setInterval(function(){
                         f(me.qrcode());
                      },(timer||60)*1000);
                      f(me.qrcode());
                   }
                   return me;
                },
        		qrcode: function (){
                   return options.token||("qraccess|"+JSON.stringify({t:Date.now()}));
                },
        		send: function (data,f){
		          if(!data._id)data._id = Date.now();
		           if(!data.token)data.token =options.token;
		           data.user = {
		             _id:'client', 
		           };
                   for(var i in data){
                     if(data[i]==undefined)delete data[i];
                   }
		           qraccess.push(data);
		        },
		        valid: function (data){
		          if(data.token==options.token){
		            if(data.user&&data.user._id=='board'){
                         return true;
		                 // if(data.shop_id==options.shop_id){

		                 //     return true;
		                   
		                 // }else{
		                 //    return 'Can not find Shop -> '+data.shop_id;
		                 // } 
		            }
		            //return 'Can not find user board.';
		          }else{
		            return 'Can not find token';
		          }
		          
		          
		        }
        	};
		},
		host : function(options){
			var fb = new Firebase(options.host);
        	var qraccess = fb.child('qraccess');
        	var loaded =0;

        	var methods = {
                onChange: function (f,timer){
                    var me = this;
                   if(f){
                      setInterval(function(){
                         f(me.qrcode());
                      },(timer||60)*1000);
                      f(me.qrcode());
                   }
                   return me;
                },
                qrcode: function (){
                   return "qraccess|"+JSON.stringify({t:options.token||Date.now()});
                },
        		send: function (data,f){
		          if(!data._id)data._id = Date.now();
 
		           if(!data.token)data.token =options.token;
		           data.user = {
		             _id:'board', 
		           };
                   for(var i in data){
                     if(data[i]==undefined)delete data[i];
                   }
		           qraccess.push(data);
		        },
		        valid: function (data){
		          if(data.token==options.token){
		            if(data.user&&data.user._id=='client'){
                        return true;
		                 // if(data.shop_id==options.shop_id){
		                 // 	return true;
		                    
		                 // }else{
		                 //    return 'Can not find Shop -> '+data.shop_id;
		                 // } 
		            }
		            //return 'Can not find user board client';
		          }else{
		            return 'Can not find token';
		          }
		          
		          
		        }
        	};

	        qraccess.limitToLast(1).on("child_added",function(snapshot){
	          if(loaded==0){
	            setTimeout(function(){
	              loaded =1;
	            },2000);
	            return;
	          }
	          var data = snapshot.val();
	          console.log('User data: ',data);
	          var s = methods.valid(data);
	          if(s===true){  

	          	if(options.onComplete)options.onComplete(data); 
              }else{
              	 if(options.onError)options.onError(s); 
              }
	        });
        	return methods;


		}
	};
})(window);
(function(win){
	$(document).on('click','.scrollable>*', function(e) {

	  e.preventDefault(); 
	  var me = $(this);
	  var scrollable = me.closest(".scrollable");
	  var x = scrollable.css("overflow-x");
	  var y = scrollable.css("overflow-y");
	  if(x=="auto" || x=="scroll"){
	    scrollable.animate({scrollLeft: me.position().left}, 750);
	  }
	  
	  if(x=="auto" || y=="scroll"){
	    scrollable.animate({scrollTop: me.position().top}, 750);
	  }

	});
})(window);
