setTimeout(function(){
    var open_old = window.open;
    window.open = function(href,title,backgroundColor){
        if(window.ReactNativeWebView){ 
            window.open({url:href,hasheader:title||0,title:title,backgroundColor:backgroundColor||"#673AB7"});
        }else{
            open_old(href);
        }
    };
    window.beforeClick = function(e){
         var ele = e.target;
 

        if(ele.nodeName=="A"){
            var href = ele.href;
            if(href){
                
                if(href.match(/^http/ig) && (ele.target=="_blank" || $(ele).hasClass("external"))){
                    e.preventDefault();
                    if(window.ReactNativeWebView){
                        var title = ele.title || ele.alt;
                        window.open({url:href,hasheader:title||0,title:title,backgroundColor:"#673AB7"});
                    }else{
                        window.open(href);
                    }
                }else if(!href.includes("data:text") && !href.includes("blob:")){
                    e.preventDefault(); 
                }
 
            }    
            
        }else{
            var href = $(ele).attr("data-router");
            if(href&&href.match(/^http/ig) ||$(ele).hasClass("external")){
                e.preventDefault();
                if(window.ReactNativeWebView){
                    var title = ele.title || ele.alt;
                    window.open({url:href,hasheader:title||0,title:title,backgroundColor:"#673AB7"});
                }else{
                    window.open(href);
                }
            }
        }
    };
    if(!window.ReactNativeWebView){
        window.addEventListener("click",window.beforeClick,true);
    }   
},200);

window.addEventListener("click",function(e){
  if(e.target.nodeName=="A"){
    e.preventDefault();
  }
},true);



