function render_menu_cate(cates){
    var s =`<div class="item  active" data-id="0">
            <div class="bg" style="background-image:url(https://static.thenounproject.com/png/210732-200.png)">  </div> 
            <div>Tất cả</div>
         </div>`;
    for(var i in cates){
        var v = cates[i];
        if(typeof v=="object"){
            s +=  `<div class="item" data-id="${v.id}">
                <div class="bg" style="background-image:url(${v.image})"> 
                    <span class="badge">${v.total}</span>
                </div> 
                <div>${v.name}(${v.total})</div>
             </div>`;
        }
    }

    $(".groupcate").html(s);
}


